import React from 'react';
import diferente from './diferente.mp4';
import './Video.css';


const Video = ({ onRouteChange }) => {
return (
  <div className="flex flex-column video-position" key='1'>
    <video className="w-50 vh-75 center " controls>
      <source src={diferente} type="video/mp4" ></source>
    </video>
    <p
      className="f1 ttu center pointer orange br2 ba b--orange"
      onClick={()=> onRouteChange('home')}

      >Home</p>
  </div>
);

}

export default Video;
